window.bookSummaryJSON = "<p><b>The monsters already own my body…but do they want my heart?</b></p> <p>Left to die in a monstrous land, I’m saved by the monster I least expect. He hates me, but he loves what my body can do for him.</p> <p>I shouldn’t want to keep him. I shouldn’t want to keep all of them. I’m just their plaything, after all. But, one by one, they find their way into my heart.</p> <p>Even as the world falls apart around me, I realize that I’ve become just as obsessed with my monsters as they are with me.</p>"; 
